import React from "react";

function Table() {
  return (
    <div>
  <table class="profileTable1" border="1">
    <thead>
      <tr>
        <td class="profileText"><h2 class="profileText">Profile</h2></td>
      </tr>
    </thead>
  </table>
</div>
  );
}

export default Table;
